import React from "react"
import cs from "./Contact.module.css"

const Contact = (props) =>{
debugger
    let checkmass =[]
    if(checkmass.length > 0){
        props.SetIsAnyContact(true)
    }
    else {
        props.SetIsAnyContact(false)
    }

    return <span>
        {props.ContactValue && checkmass.push(1)}

        {props.ContactValue &&
        <div className={cs.contact} >
        {props.ContactName} : {props.ContactValue}
        </div>
        }
    </span>
}


export default Contact
